import React from 'react';

const Suggestions = (props) => {
    if (props.results[0]) {
    const options = props.results.map((x, y) => (
        <li key={y}>{x.title}</li>
    ))

    console.log(options);
    return <ul>{options[0].title}</ul>

    } else return null;
        
}

export default Suggestions
